import React, { useState } from 'react';

function PairingDashboard() {
  const [pairs, setPairs] = useState([
    { student1: 'Alice', student2: 'Bob' },
    { student1: 'Charlie', student2: 'David' },
  ]);

  return (
    <div className="pairing-dashboard">
      <h2>Pairing Dashboard</h2>
      <ul>
        {pairs.map((pair, index) => (
          <li key={index}>
            {pair.student1} & {pair.student2}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default PairingDashboard;
